import React from "react";

class Header extends React.Component{
    render(){
        return(
            <header id="header">
                <div className="center text-center">
                    <h1 className="bigheadline">Devendra More</h1>
                    <h4 className="subheadline">The Worst Front End Developer</h4>
                </div>
                <div className="bottom">
                    <a data-scroll href="#navigation" className="scrollDown animated pulse" id="scrollToContent"><i className="pe-7s-angle-down-circle pe-va"></i></a>
                </div>
            </header>
        );
    };
}
export default Header;
